import React from 'react'

const ListTask = () => {
    return (
        <div className='col-4 mt-2 card ' style={{ "margin": "auto" }}>
            <div className='card-body'>
                <ul >
                    <li className="d-flex justify-content-between"><span>kdfjmqk</span> <span><button className='btn btn-outline-dark'>Edit</button> <button className='btn btn-danger'>Delete</button></span></li>
                </ul>
            </div>

        </div>
    )
}

export default ListTask
